export function ContinueButton(Props: { marketYear: number }) {
    const { marketYear } = Props;
    function goToMarket(){
        console.log('Going to market year', marketYear);
    }
    return (
        <div className="continue-button">
            <button
            onClick={goToMarket}>Continue to {marketYear}</button>
            </div>

    );
}
